text:
happy monday, everyone! while our #crowdfunding â€˜taking marilynâ€™s untold truth to broadwayâ€™ is running in the #linkinbio, today we give you an insight on the playwrightâ€™s creative process. hereâ€™s an extract from @argiacoppolaâ€™s interview with @corriere corriere della sera, la lettura, november 17th 2017 â€“ just before our international opening in turin, italy:

today, in looking back at the genesis of the text, @argiacoppola says she is convinced that it was born out of â€œan ensemble of factors and coincidences, partly inexplicable, or explicable after the fact: a desire and an ambition to write about a controversial, revolutionary and tragic female character.â€ the choice did not immediately fall on marilyn, however. â€œfor me, this was not an obsession,â€ argia stresses, â€œby which i mean that it was marilyn who chose me to write her story: a trip to new york in 2012 which then became a decision to finish my phd in playwrighting at columbia university, and to choose a creative project to produce on the spot. my first work in english.â€ the fifty years since marilynâ€™s death have brought with them the beginnings of a more complex way of talking about the star. â€œunpublished material emerged, never exposed. around that same time, my trusted bookseller literally put oatesâ€™s novel into my hands, telling me that to understand america, i would need to get through it.â€ _______________________

@argiacoppola is an italian playwright and poet based in new york. her previous work includes numerous plays that have been produced and published throughout europe to great acclaim, and has been featured at the festival of performing arts in algiers, the greek festival of epidauro, and at the inda festival in sicily â€“ among many others. argia holds a ba in playwriting and dramaturgy from d.a.m.s. (school of arts), an mfa in drama from the teatro stabile in turin, and a phd in drama with a playwriting concentration from columbia university. she is a current member of the dramatist guild of america.

